import React from "react";
import { View, Text, Image } from "react-native";
import { StyleSheet as WebStyles, css } from "aphrodite";
const DAOlogoheader = () => (
  <Image
    style={css(styles.daologoheader)}
    source={require("./assets/img/DAOtutorlogotest3.png")}
  />
);
class TopView extends React.Component {
  render() {
    return (
      <View style={css(styles.topInfo)}>
        <DAOlogoheader />
        <Text style={css(styles.daotutorstext)}>DAO Tutors</Text>
      </View>
    );
  }
}

const styles = WebStyles.create({
  topInfo: {
    height: 100,
    justifyContent: "flex-start",
    backgroundColor: "#764ABC",
    flexDirection: "row",
    alignContent: "center",
  },
  daotutorstext: {
    //position: "absolute",
    paddingLeft: 150,
    fontFamily: "Manrope-ExtraBold",
    fontSize: 40,
    color: "white",
    alignSelf: "center",
  },
  daologoheader: {
    left: 70,
    height: 70,
    width: 70,
    ":hover": {
      backgroundColor: "white",
    },
    alignSelf: "center",
  },
});

export default TopView;
